window.bookSummaryJSON = "<p>The best-selling series, complete in a single volume. Star-spanning action and intrigue.</p> <p>A Nation at War: After aliens attack without warning and slaughter half the human race, a new country emerges. Using alien technology and desperate ingenuity, the reborn USA carves a place for itself in a violent universe, thanks to its deadly Navy and the dreaded Warp Marine Corps.</p> <p>Together for the first time, here are the five novels of the Warp Marine Corps Series.</p>"; 
